import React from "react";
import style from "./BodyBlock.module.css";

function BodyBlock() {
  return (
    <div className={style.body}>
      <div className={style.list}>
        <ul>
          <li><a></a> Normal</li>
          <li><a></a> Good</li>
          <li><a></a> Busy</li>
          <li><a></a> Hot</li>
          <li><a></a> Upkeep</li>
        </ul>
      </div>
    </div>
  );
}

export default BodyBlock;
